/*
 * Convert string to integer.  Just like atoi(), but checks for
 * preceding 0x or 0 and uses hex or octal instead of decimal.
 */
int
stoi(char *s)
{
   int base = 10;
   int n = 0;
   int sign = 0;

   /* Skip whitespace */
   while (isspace(*s)) s++;

   /* Check for sign */
   if (*s == '-') {
       sign = 1;
       s++;
   } else {
      if (*s == '+')
         s++;
   }

   if (*s == '0') {
      s++;
      if (*s == '\0') {
      } else {
         if (*s == 'x' || *s == 'X') {
            s++;
            base = 16;
         } else {
            base = 8;
         }
      }
   }
   while (*s)
      n = n * base + xdtoi(*s++);

   if (sign) n *= -1;
   return n;
}


/*
 * Convert string to float.  Just like atof(), but checks for
 * preceding 0x or 0 and uses hex or octal instead of decimal.
 */

float
stof(char* s)
{
   float retn = 0.0, frac = 0.0;
   int sign = 0;
     
   /* Skip whitespace */
   while (isspace(*s)) s++;
     
   /* Check for sign */
   if (*s == '-') { 
       sign = 1;
       s++; 
   } else {
      if (*s == '+')
         s++;
   }
     
   /* Read integer part */
   while (isdigit(*s))
      retn = retn * 10 + (*(s++) - '0');
     
   /* Read fractional part */ 
   if (*s == '.') {
      float q;
      s++;
      while (isdigit(*s)) s++; 
      s--;
      do {
         q = *s - '0';
         frac = (frac + q) / 10;
      } while (isdigit(*(--s)));
      while (isdigit(*(++s))) s++;
   }
     
   /* Skip whitespace */
   while (isspace(*s)) s++;
     
   /* Combine integer and fractional part, and apply sign */
   retn += frac;
   if (sign) retn *= -1;
     
   /* Process E notation */
   if (*s == 'e' || *s == 'E') {
       int i, j = atoi(++s);
       if (j == 0) return retn;
       for (i = 0; i != j; (j > 0) ? i++ : i--)
           retn *= (j > 0) ? 10 : -10;
   }
   return retn;
}

